import React, { Component } from "react";
import { MDBContainer, MDBMask, MDBView } from "mdbreact";
import { storage } from "./index";
import FooterPage from "./footer.js";
import BackGroundVideo from "./components/BackGroundVideo";

class main extends Component {
  state = {
    videoSrc:
      "https://firebasestorage.googleapis.com/v0/b/socialtrip-f5408.appspot.com/o/BackGround%20Video%2FNew%20Zealand%20Fiordland%20National%20Park%20tiny%20waterfall_preview.mp4?alt=media&token=e69478af-32ee-4236-8351-98f3123b4a7b",
  };

  componentDidMount() {
    console.log("in comp fathdser");
    const storageRef = storage.ref();
    const imagesRef = storageRef.child("BackGroundVideo");
    imagesRef.listAll().then((res) => {
      res.items.forEach((element, index) => {
        if (index == 0) {
          element.getDownloadURL().then((url) => {
            console.log(url);
            this.setState({
              videoSrc: url,
            });
          });
        }
      });
    });
  }

  render() {
    console.log("in fathder render");
    console.log(this.state.videoSrc);
    return (
      <div>
        <MDBView>
          <BackGroundVideo videoSrc={this.state.videoSrc} />
        </MDBView>
        <main>
          <MDBContainer className="text-center my-5"></MDBContainer>
        </main>
        <FooterPage />
      </div>
    );
  }
}

export default main;
